import React from "react";
import Header from "./Header";
import { Router, Route } from "react-router-dom";

const App = () => {
  return (
    <Router>
      <div>
        <Header />
        <Route path="/" exact component={MovieList} />
        <Route path="/movies" exact component={MovieDetails} />
      </div>
    </Router>
  );
};

export default App;
